import Axios from 'axios';
import React, {useState, useEffect} from 'react';
import './App.css';

function App(props) {
  const [data, setData] = useState([])

  const fetchData = async () => {
    const response = await Axios.get(
      'http://localhost:8080/chat/rooms'
    );
    console.log(response.data)
    setData(response.data); // 데이터는 response.data 안에 들어있습니다.
  };

  useEffect(() => {
    fetchData();
  }, []);


  return (
    <div className="App">
        <h1>Hey, there!</h1>
        <div>{data.map(room => <h2>{room.name}</h2>)}</div>
        <label> 방 제목
        <input type="text" name="name"/><button>개설</button>
        </label>

    </div>
  );
}

export default App;
